import React from 'react';
import { View, Text, Image, StyleSheet } from 'react-native';

export function Home({ navigation }) {
    return (
        <View style={styles.titleMobile}>
            <Text style={styles.headerText}>Kathariana & Patrick</Text>
            <View style={styles.imageContainer}>
                <Image source={require('../assets/placholder.jpeg')} style={styles.mainImage} />
                <Image source={require('../assets/framegold.png')} style={styles.frameImage} />
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    titleMobile: {
        alignItems: 'center',
        marginTop: 15,
    },
    headerText: {
        fontFamily: 'Great Vibes',
        fontSize: 48,
        textAlign: 'center',
    },
    imageContainer: {
        position: 'relative',

        zIndex: -1,
        border: "solid red",
    },
